import React from "react";

function Projects() {
  function projectBox(name, img, link, src) {
    let imageTag = "url('" + img + "')";
    return (
      <div style={{ background: imageTag }} className="projectContainer"></div>
    );
  }
  return (
    <div className="projects">
      <h1>Projects</h1>
      {projectBox(
        "Weather App",
        "https://imgur.com/RrhiXAL",
        "https://houston-weather.netlify.com/",
        "https://github.com/johnhartmann26/react-weather"
      )}
    </div>
  );
}

export default Projects;
